export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{EAG1JdYN48:{data:{id:2059,attributes:{imdbId:"tt0119879",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjExOGUxZTUtNWYzMi00Y2Q3LWFlOGQtZTc4YTFkYTNkNjQyXkEyXkFqcGdeQXVyNzgzODI1OTE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"36%"}],item_lang:{data:{id:2722,attributes:{title:c,plot:"Rough girl Perdita and her demonic lover Romeo Dolorosa need humans to sacrifice following Romeo's religion before he can go on a mission ordered by mob boss Santos. They kidnap teen sweethearts Duane and Estelle and travel with them to Las Vegas.",slug:"perdita-durango"}}},books:{data:[{id:10244,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:true,published:g,publisher:h,subtitle:d}},{id:10245,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:b,published:g,publisher:h,subtitle:d}},{id:10246,attributes:{title:"Neon Lit:perdita Durango",description:"When the ravishing Tex-Mex femme fatale Perdita Durango and her small-time drug-dealing boyfriend, Romeo Dolorosa, pull out of Texas with two cute white hostages in the cab and a boatload of heroin in the trunk, no one is safe from Galveston to Los Angeles.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hc4jGwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Bob Callahan"],firstBook:b,published:"1995-12-01",publisher:"Harper Perennial",subtitle:d}},{id:10247,attributes:{title:"The Rooster Trapped in the Reptile Room",description:"\"Everything I have to say about race and religion and politics is in the novels,\" declares Barry Gifford. The Rooster Trapped in the Reptile Room gathers generous portions of all thirteen novels and novellas, as well as first-person essays, generous helpings of poetry, journalism, and a new interview with the author. The broad contours of an episodic output emerge—a full-length view of the freaks and freakish incidents that populate Gifford’s unique human comedy. A world, as Lula, the author’s favorite of all his characters, reflects, \"wild at heart and weird on top.\" The Rooster Trapped in the Reptile Room provides essential reading for anyone after the soul of American writing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qOAqxfK4w0UC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:i,publisher:j,subtitle:"A Barry Gifford Reader"}},{id:10248,attributes:{title:"Sailor & Lula",description:"On the twentieth anniversary of the publication of Barry Gifford's international bestseller, Wild at Heart, as well as the anniversary of the Palme d'Or–winning film adaptation by director David Lynch, Sailor & Lula: The Complete Novels presents all of the novels and novellas that comprise the saga of Sailor Ripley and Lula Pace Fortune, \"the Romeo and Juliet of the South\": Wild at Heart, Perdita Durango (also made into a feature film), Sailor’s Holiday, Sultans of Africa, Consuelo’s Kiss, Bad Day for the Leopard Man, and The Imagination of the Heart.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RG0-2ftUV2oC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:i,publisher:j,subtitle:"The Complete Novels"}}]}}},meta:{}}},prerenderedAt:1680940944368}}("Barry Gifford",null,"Perdita Durango","","Bad girl Perdita Durango and her dealer boyfriend Romeo Dolorosa get their kicks on a journey from Louisiana to Los Angeles that involves santeria rituals and kidnapping.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6J2_GZvaj80C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","1996-01-01","Grove Press","2011-01-04","Seven Stories Press"))